import React from "react";

const CountryBtn = (props) => {
  const country = props.country;
  console.log(country);
  return (
    <div className="flex flex-col">
      <div className="w-44 h-44 bg-red-500 rounded-full">
        <div>
          <div></div>
        </div>
      </div>
      <div className="bg-violet-400">{country.name.common}</div>
    </div>
  );
};

export default CountryBtn;
